class Solution {
    func constructProductMatrix(_ grid: [[Int]]) -> [[Int]] {
        let n = grid.count
        let m = grid[0].count
        var p = Array(repeating: Array(repeating: 0, count: m), count: n)

        // Calculate the total product of all elements in the grid
        var totalProduct = 1
        for i in 0..<n {
            for j in 0..<m {
                totalProduct = (totalProduct * grid[i][j]) % 12345
            }
        }

        // Calculate the product matrix p
        for i in 0..<n {
            for j in 0..<m {
                var productWithoutCurrent = totalProduct

                // Divide by the current element and take modulo
                if grid[i][j] != 0 {
                    productWithoutCurrent = (productWithoutCurrent * powMod(grid[i][j], 12345 - 2, 12345)) % 12345
                }

                p[i][j] = productWithoutCurrent
            }
        }

        return p
    }

    // Modular exponentiation (to find modular multiplicative inverse)
    private func powMod(_ base: Int, _ exponent: Int, _ modulus: Int) -> Int {
        var result = 1
        var b = base % modulus
        var e = exponent

        while e > 0 {
            if e % 2 == 1 {
                result = (result * b) % modulus
            }
            e /= 2
            b = (b * b) % modulus
        }

        return result
    }
}
